  const [categories, setCategories] = useState([]);
  useEffect(() => {
    setCategories(picData.map((el) => el.category));
  }, []);
  console.log(categories);
  return (
    <section className="home">
      <div>HOME</div>
      <PicCategory picData={picData} />
    </section>
  );
};

export default Home;
